-46f5-b961-8fbf0b31593a"},{"version":"CommandV1","origId":988223686855562,"guid":"4d7b758b-c6a6-4ef3-b435-cfef269ca045","subtype":"command","commandType":"auto","position":23.75,"command":"%md\n### Conclusion\n\nTo sum up, we discovered the following influencing factors and dependencies:\n\n* __Time of day__. The total dollar amount is maximal before business hours and in the end of business day and minimal in early morning.\n\n* __Day of week__. The total dollar amount is much higher on weekdays that on weekend. The chances to write an expensive ticket are also higher on weekdays. \n\n* __Month__. The least profitable month is December. The second to worst is February. \n\n* __Top kinds of infractions__ are related to parking in prohibited zones, prohibited time and on private property.\n\n* __Proximity to places of interest__ contributes to higher tickets revenue.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.473562844019E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"ec14ee00-5a58-444d-8b95-8cf0a648981c"},{"version":"CommandV1","origId":988223686855561,"guid":"e82b798b-613a-497b-b45a-0246e8e7e6d3","subtype":"command","commandType":"auto","position":23.875,"command":"%md\n### Further Research\n\nIn this project we managed to qualify some factors which have an influence on the total tickets revenue and quantify only one of them (days of week).\nIt would be worth it to answer a questions \"how to quantify the influence of the proximity to places of interest\" and \"what kind of data we have/need for that?\" In this case we would obtain a measurable criteria necessary for the formulation and hopefully succesful solution of the optimization problem on distribution/planning of limited parking enforcement resources. ","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.473562844032E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"ed2ffc39-9639-4219-8120-e31b66d8d45e"},{"version":"CommandV1","origId":988223686855556,"guid":"f7d45be7-22ed-46fd-8421-b7d8ddf76c07","subtype":"command","commandType":"auto","position":24.0,"command":"%md\n### References\n\n1. [Parking Tickets Open Data](http://www1.toronto.ca/wps/portal/contentonly?vgnextoid=ca20256c54ea4310VgnVCM1000003dd60f89RCRD)\n2. [Address Points (Municipal) - Toronto One Address Repository](http://www1.toronto.ca/wps/portal/contentonly?vgnextoid=91415f9cd70bb210VgnVCM1000003dd60f89RCRD)\n3. [Places of Interest and Toronto Attractions Open Data](http://www1.toronto.ca/wps/portal/contentonly?vgnextoid=d90ac71db136c310VgnVCM10000071d60f89RCRD&vgnextchannel=8896e03bb8d1e310VgnVCM10000071d60f89RCRD)\n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0.0,"submitTime":1.473562844047E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"comment
